contract RecoverMarketplace is Marketplace{
	bytes32[] public mNames;

	/* Orders */
	function getSubscriptionsSize(bytes32 _dataSourceName) public returns (uint256 size){
		size = mOrders[_dataSourceName].length;
	}
	function getSubscriptionAt(bytes32 _dataSourceName, uint256 _index) public returns (uint256 size){
		mOrders[_dataSourceName][_index];
	}
	/* Data providers */
	function getProviderNamesSize() public view returns(uint256 size){
		size = mNames.length;
	}
	function getNameAt(uint256 _index) public view returns(bytes32 _dataSourceName){
		if(0 <= _index  && _index <= mNames.length){
			_dataSourceName = mNames[_index];
		}
	}

}
